cy.wait(500);
// Si aplica tipo de abono (cuentas por cobrar/pagar)
if (reporte.tipoAbono) {
  cy.get(`[onclick="seleccionarTipoAbono('${reporte.tipoAbono}')"]`).should("be.visible").click();
  cy.wait(300);
}
// Trabajar dentro del modal
cy.get(".modal.show").should("be.visible").within(() => {
  // Si requiere selección de filtro
  if (escenario.tieneFiltro && escenario.filtroFuncion) {
    cy.get(`[onclick="${escenario.filtroFuncion}('${escenario.tipo}')"]`, {
      timeout: 3000
    }).click();
  }
  // Llenar campos o ejecutar acciones
  escenario.filtros.forEach(filtro => {
    if (filtro.accion === "click") {
      if (filtro.id) cy.get(filtro.id).click();
      if (filtro.class) cy.get(filtro.class).click();
    } else {
      cy.get(filtro.id).should("be.visible").clear().type(filtro.valor);
    }
  });
  // Generar PDF y XLS
  cy.get("button[value='pdf']").click();
  cy.wait(800);
  cy.get("button[value='xls']").click();
  cy.wait(800);
  // Si es un reporte de abonos, volver al tipo principal
  if (reporte.tipoAbono) {
    cy.get(`[onclick="regresarTipoAbono()"]`).click();
    cy.wait(300);
  }
  // Cerrar modal
  cy.get("button[aria-label='Close']").click();
});
// Confirmar cierre
